{"": "", "Configure": "\u0636\u0628\u0637", "Create": "\u0623\u0646\u0634\u0626", "Default root password is <code>admin</code>": "\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629 \u0644\u062d\u0633\u0627\u0628 root \u0647\u064a <code>admin</code>", "Filesystem root": "\u0646\u0638\u0627\u0645 \u0645\u0644\u0641\u0627\u062a \u0627\u0644\u062c\u0630\u0631", "New password": "\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u062c\u062f\u064a\u062f\u0629", "New user name": "\u0627\u0633\u0645 \u0645\u0633\u062a\u062e\u062f\u0645 \u062c\u062f\u064a\u062f", "OK": "\u0645\u0648\u0627\u0641\u0642", "Permissions": "\u0627\u0644\u0635\u0644\u0627\u062d\u064a\u0651\u0627\u062a", "Save": "\u062d\u0641\u0638", "Sidebar entries": "\u0625\u062f\u062e\u0627\u0644\u0627\u062a \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a", "System account": "\u0627\u0644\u0649 \u062d\u0633\u0627\u0628 \u0627\u0644\u0646\u0638\u0627\u0645", "This only affects appearance of the sidebar. Disable actual permissions under the <b>Permissions</b> tab.": "\u0647\u0630\u0627 \u0633\u064a\u0624\u062b\u0631 \u0639\u0644\u0649 \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a \u0641\u0642\u0637. \u064a\u0645\u0643\u0646\u0643 \u062a\u063a\u064a\u064a\u0631 \u0627\u0644\u0623\u0630\u0648\u0646\u0627\u062a \u062a\u062d\u062a \u062a\u0628\u0648\u064a\u0628\u0629 <b>\u0623\u0630\u0648\u0646\u0627\u062a</b>.", "This user will be constrained by POSIX permissions for the selected system account.": "\u0633\u064a\u062a\u0645 \u062a\u0642\u064a\u064a\u062f \u0647\u0630\u0627 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0628\u0623\u0630\u0648\u0646\u0627\u062a POSIX \u0644\u062d\u0633\u0627\u0628 \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u0645\u062d\u062f\u062f.", "Update password": "\u062a\u062d\u062f\u064a\u062b \u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631", "You have no users mapped to <b>root</b> system account. Saving this configuration will prevent any administrative access.": "\u0644\u064a\u0633 \u0644\u062f\u064a\u0643 \u0623\u064a \u0645\u0633\u062a\u062e\u062f\u0645 \u0645\u0631\u0628\u0648\u0637 \u0628\u062d\u0633\u0627\u0628 \u0627\u0644\u0646\u0638\u0627\u0645 <b>root</b>. \u062d\u0641\u0638 \u0647\u0630\u0647 \u0627\u0644\u0627\u0639\u062f\u0627\u062f\u0627\u062a \u0633\u064a\u0645\u0646\u0639 \u0623\u064a \u0635\u0644\u0627\u062d\u064a\u0627\u062a \u0625\u062f\u0627\u0631\u064a\u0629.", "Custom users": "\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646 \u0645\u062e\u0635\u0635\u064a\u0646", "Users": "\u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646", "Password updated": "\u062a\u062d\u062f\u064a\u062b \u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 "}